(2, 'আগুন নিয়ন্ত্রণে এলেও এখনো ধোঁয়াচ্ছন্ন পুরো', 'agun-niyntrne-eleoo-ekhno-dhonnyacchnn-puro', 5, '/common/images/news/1698386828.png', 'no body 1', '<p><span style=\"font-family: &quot;Libre Franklin&quot;, sans-serif; text-align: right;\"><font color=\"#000000\" style=\"\">ব্যবসায়ীরা পুড়ে যাওয়া দোকান হাতড়ে খুঁজছেন, কিছু পাওয়া যায় কি না। তবে তাদের ভাষ্য, \'ছাই ছাড়া কিছু নেই\'। ব্যবসায়ীরা জানান, মোহাম্মদপুর কৃষি মার্কেটের যে অংশে আগুন লেগেছে সেটা নতুন বাজার নামে পরিচিত। ওই মার্কেটে সাড়ে চার শতাধিক দোকান ছিল। সেগুলোর মধ্যে সোনার দোকান, কাপড়ের দোকান, বাসনপত্রের দোকান, কাঁচাবাজারসহ বিভিন্ন ধরনের দোকান ছিল। সেগুলোর সবই এখন পুড়ে ছাই হয়ে গেছে।</font></span><br></p>', 1, 0, '2023-10-25 00:04:27', '2023-10-27 00:07:08'),
