(10, 'ঘটতে পারে যে কোনো কিছুই, আশাবাদী তাসকিন', 'ghtte-pare-ze-kono-kichui-asabadee-taskin', 3, '/common/images/news/1698400189.webp', NULL, '<p>ইডেন গার্ডেনে সংবাদ সম্মেলন হাসিমুখে শেষ করে তাসকিন আহমেদ বললেন, ‘সবাই \r\nদোয়া করবেন।’ কলকাতার ইডেন গার্ডেনে বিশ্বকাপে আগামীকাল নেদারল্যান্ডসের \r\nমুখোমুখি হবে বাংলাদেশ। কাগজে-কলমে ও র‌্যাঙ্কিংয়ে ডাচরা বাংলাদেশের চেয়ে \r\nপিছিয়ে থাকলেও স্কট এডওয়ার্ডসের দলকে হালকাভাবে নেওয়ার সুযোগ নেই। এরই \r\nমধ্যে দক্ষিণ আফ্রিকাকে হারিয়ে চমক দেখিয়েছে তারা। নিন্দুকেরা বলতে পারেন, \r\nতাসকিন কি সে জন্যই সবার কাছে দোয়া চাইলেন! ভুল। সংবাদ সম্মেলনে সারল্যমাখা\r\n হাসিতে তাসকিনের সব প্রশ্নের উত্তর দেওয়াই বলে দেয়, বিনয় বাংলাদেশের এই \r\nপেসারের সহজাত বৈশিষ্ট্য।</p><div class=\"   \r\n                  story-element\"><div class=\"story-element story-element-text\"><div><p>ঠিক যেভাবে সংবাদ সম্মেলনে সেমিফাইনালের প্রসঙ্গ উঠতেও হেসে ফেলেছেন তাসকিন। তাঁর কাছে জানতে চাওয়া হয়েছিল, বাংলাদেশের সেমিফাইনালে ওঠার স্বপ্ন যেহেতু বড় ধাক্কা খেয়েছে, আগামী ৪ ম্যাচে দলের কি লক্ষ্য থাকবে?</p><p>তাসকিনের উত্তরটি জানানোর আগে বিশ্বকাপের পয়েন্ট টেবিলে বাংলাদেশের অবস্থান জানিয়ে রাখা ভালো। ৫ ম্যাচে ১ জয় ও ৪ হারে ২ পয়েন্ট নিয়ে অষ্টমস্থানে বাংলাদেশ। হাতে আছে আর ৪ ম্যাচ। এই চার ম্যাচে বাংলাদেশের প্রতিপক্ষ—নেদারল্যান্ডস, পাকিস্তান, অস্ট্রেলিয়া ও শ্রীলঙ্কা। তাসকিন এসব প্রতিপক্ষ সামনে রেখেই উত্তর দিয়েছেন, ‘আশা এখনো শেষ হয়নি। এখনো ৪ ম্যাচ আছে এবং আমরা যদি এই ৪ ম্যাচ জিততে পারি, তাহলে যেকোনো কিছুই ঘটতে পারে। কারণ, রানরেটের হিসাব আছে।’</p><p>তাসকিন এরপর ব্যাখ্যা করলেন, ‘ইংল্যান্ড দল আফগানিস্তান ও শ্রীলঙ্কার কাছে \r\nহেরেছে। তাই আমরা ৪টি ম্যাচ জিততে পারলে দৃশ্যপট পাল্টেও যেতে পারে। কিন্তু\r\n এখন আমরা ম্যাচ ধরে ধরে এগোতে চাই। হ্যাঁ, আমরা প্রত্যাশা অনুযায়ী ভালো \r\nকরতে পারিনি। সেটি ব্যাটিং-বোলিং দুই বিভাগেই। তবে এখনো হাতে ৪ ম্যাচ আছে \r\nএবং আমরা এসব ম্যাচে ভালো করতে চাই।’</p><p>তাসকিনের কাছে জানতে চাওয়া হয়েছিল, ব্যাটিং, বোলিং, ফিল্ডিং—ক্রিকেটের এই \r\nতিন বিভাগের কোথায় কোথায় ভুল হচ্ছে বলে মনে করেন? উত্তরে তাসকিন বলেছেন, \r\n‘ফিল্ডিংয়ে টুর্নামেন্টজুড়েই আমরা ভালো করছি। কিন্তু ব্যাটিং ও বোলিংয়ে \r\nপ্রত্যাশা অনুযায়ী পারফর্ম করতে পারিনি। তাই এ দুটি বিভাগে উন্নতির অনেক \r\nজায়গা আছে। আমরা জানি, যেভাবে খেলছি আমরা, তার চেয়ে ভালো দল ও সামর্থ্যও \r\nআছে। কিন্তু এটা ঠিক ভালো করতে পারছি না। তাই আগামী চার ম্যাচেই ভালো করতে \r\nচাই।’</p><p>বিশ্বকাপে আগামীকালই প্রথম ম্যাচ অনুষ্ঠিত হবে ইডেন গার্ডেনে। ভারতের এই \r\nমাঠে তাসকিন একটি টেস্ট খেলেছেন। এবার ওয়ানডে খেলতে এসে উইকেট কেমন দেখলেন \r\nপ্রশ্নে তাসকিনের জবাব, ‘আগামীকাল আমরা এখানে (ইডেন গার্ডেনে) বিশ্বকাপের \r\nপ্রথম ম্যাচ খেলব। তাই এখানে আগে কোনো ম্যাচ আমরা দেখিনি। সম্ভবত উইকেট খুব\r\n ভালো হবে। স্পোর্টিং উইকেট আশা করছি। এখানে আমি আগে যখন খেলেছি, যেটা \r\nদেখেছি, ব্যাটিং করার জন্য খুব ভালো ছিল। আউটফিল্ডও খুব ফাস্ট। তবে \r\nব্যাটসম্যানদের পাশাপাশি বোলারদের জন্যও সাহায্য থাকবে। তাই আমার মনে হয়, \r\nস্পোর্টিং উইকেটই হবে।’</p></div></div></div><p></p>', 1, 0, '2023-10-27 03:49:49', '2023-10-27 03:49:49');
