(11, 'ভয়ংকর সুন্দর’ অভিনেত্রী ভাবনার মেকআপ ছাড়া ছবি', 'vyngkr-sundr-ovinetree-vabnar-mekap-chara-chbi', 4, '/common/images/news/1698400807.webp', NULL, '<p>সামাজিক যোগাযোগমাধ্যমে সক্রিয় ‘ভয়ংকর সুন্দর’ অভিনেত্রী আশনা হাবিব ভাবনা।\r\n প্রায় নতুন নতুন ছবি শেয়ার করেন ফেসবুক, ইনস্টাগ্রামে। আজ বৃহস্পতিবার \r\nশেয়ার করলেন বেশ কিছু নতুন ছবি। ছবিগুলোর বৈশিষ্ট্য মূলত মেকআপ ছাড়া ভাবনা।\r\n হঠাৎ মেকআপ ছাড়া ছবি কেন? জানতে চাইলে ভাবনা বলেন, ‘মেকআপ ছাড়া ছবি তুলতে\r\n চাচ্ছিলাম। বরাবরই আমার মেকআপ ছাড়া ছবি তুলতে ভালো লাগে, এবার যুক্ত \r\nহয়েছে কাজল।’ চলুন দেখে নিই ভাবনার সাম্প্রতিক সময়ে মেকআপ ছাড়া ছবি |</p><p></p><div class=\"story-element-caption-attribution-wrapper\"><img style=\"width: 100%;\" src=\"data:image/webp;base64,\" data-filename=\"prothomalo-bangla_2023-10_658c76cc-5298-46b1-a473-fc6c38043178_WhatsApp_Image_2023_10_26_at_12_39_22_PM.webp\"><figcaption class=\"story-element-image-title\"><br></figcaption></div><div class=\"story-element-caption-attribution-wrapper\"><figcaption class=\"story-element-image-title\">চলচ্চিত্রে ভাবনার \r\nক্যারিয়ার শুরু হয় ‘ভয়ংকর সুন্দর’ সিনেমা দিয়ে। অনিমেষ আইচ পরিচালিত \r\nসিনেমাটিতে তাঁর সহশিল্পী ছিলেন পরমব্রত চট্টোপাধ্যায়। সিনেমাটি মুক্তি পায়\r\n ২০১৭ সালে</figcaption></div><div class=\"story-element-caption-attribution-wrapper\"><figcaption class=\"story-element-image-title\"><br></figcaption><figcaption class=\"story-element-image-attribution\"></figcaption></div><p><img style=\"width: 100%;\" src=\"data:image/webp;base64,\" data-filename=\"prothomalo-bangla_2023-10_f399e11e-c488-4407-9c98-61440340566c_WhatsApp_Image_2023_10_26_at_12_38_07_PM.webp\"></p><div class=\"story-element-caption-attribution-wrapper\"><figcaption class=\"story-element-image-title\">ছবি আঁকা ভাবনার শখ। ক্যানভাসে ছবি আঁকার মুহূর্তে ছবিগুলো তোলা</figcaption><figcaption class=\"story-element-image-attribution\"></figcaption></div><p><br></p>', 1, 0, '2023-10-27 04:00:07', '2023-10-27 04:06:54');

